import {
  FETCH_SINGLE_PRODUCT,
  CHANGE_CURRENCY,
  RECEIVE_PRODUCTS,
} from "../constants/ActionTypes";

const initialState = {
  products: [],
  symbol: "$",
  product_details: [],
};

const userWooReducer = (state = initialState, action) => {
  console.log(action);
  switch (action.type) {
    case RECEIVE_USERWOO:
      return {
        ...state,
        userwoo: action.userWoo,
      };

    case FETCH_USERWOO: {
      return {
        ...state,
        userwoo: action.userwoo,
      };
    }
  }
};
export default userWooReducer;
